import React from "react";

const Newsletter = () =>{
    return(
        <div className="news">
            <div className="container">
                <div className="row">
                    <div className="col">
                        <h2 className="heading">Newsletter Subscription</h2>
                        </div>
                </div>
            </div>
        </div>
    )
}

export default Newsletter;
